import './App.css';

function App() {
  return (
    <div className="App">
      <div className="header">
        <h2>Healthy</h2>
        <nav>
          <ul>
            <li><a href="#">Home</a></li>
            <li><a href="#">Our Menu</a></li>
            <li><a href="#">Promo</a></li>
            <li><a href="#">Order</a></li>
          </ul>
        </nav>
      </div>
    </div>
  );
}

export default App;
